        <Post title='Lecture 03' description='Lorem ipsum dolor sit amet consectetur adipisicing elit. Possimus deserunt deleniti quos perferendis assumenda dolorum expedita. Nemo, recusandae laborum magni dolores porro minima quos accusamus non illo doloremque! Ducimus, rem!' tags={["Tag 01","Tag 02"]}/>
        <Post title='Lecture 04' description='Lorem ipsum dolor sit amet consectetur adipisicing elit. Possimus deserunt deleniti quos perferendis assumenda dolorum expedita. Nemo, recusandae laborum magni dolores porro minima quos accusamus non illo doloremque! Ducimus, rem!' tags={["Tag 01","Tag 02", "Tag 01","Tag 02", "Tag 01","Tag 02"]}/>
      </div>
    )
    
  }
}
